import { Link, useParams,useNavigate } from "react-router-dom";
import { select_route } from "../api";
import { useEffect,useState } from "react";
import Personal_goal from "./personal_goal";
import Performance_per_month from "./performance_per_month";
import Performance_per_year from "./performance_per_year";
import  {Return_component}  from "../backend_component/data_input";
import { Loading } from "../backend_component/loading";
const Banch_page=({data})=>{
    var permession=window.sessionStorage.getItem('permession')
    const {page}=useParams()
    const {article_page}=useParams()
    const navigate=useNavigate()
    const [page_data_arr,set_page_data_arr]=useState()


    useEffect(()=>{
        set_page_data_arr(data)
    },[page,article_page])

    if(!page_data_arr){
        return(<Loading/>)
    }
    else if(permession==='admin'){
        return(
            <>

                <Return_component number={4} page={page} arr_params={page_data_arr} />
            </>
        )
    }
    else if(permession==='manager'){
        return(
            <>

                <Return_component number={3} page={page} arr_params={page_data_arr} />


            </>
        )
    }



}
export default Banch_page;
